import React from 'react';
import ApolloClient from 'apollo-boost';
import { ApolloProvider } from '@apollo/react-hooks';
import { InMemoryCache } from 'apollo-cache-inmemory';
import NameSearch from './NameSearch';
import SubmitSearch from './submitData';
import { resolvers } from "./resolvers";
import '../application.css'
declare let module: any;

// Instantiate cache and Apollo client
let cache = new InMemoryCache({
  dataIdFromObject: object => object.__typename || 'Player'
});
const client = new ApolloClient({
  uri: 'http://192.168.1.67:5000',
  cache: cache,
  resolvers: resolvers,
});

// Initialize cache data
cache.writeData({
  data: {
    __typename: 'Player',
    searchStr: '',
    name: '',
    playerId: 13110,
    startDate: '01/01/2018',
    endDate: '12/31/2018',
  },
});

// main function - note app is not a functional component as we had with redux
function BaseballApp(): any {
  return (
    <ApolloProvider client={client}>
      <div className="app">
        <NameSearch />
        <br />
        <SubmitSearch />
        </div>
    </ApolloProvider>
  );
}

// add hot updates
if(module.hot){
  module.hot.accept();
}

export default BaseballApp
